scriptlet.script:
var vms = JSON.parse(scriptletContext.get("vMachines"));
var rp = vms[rgName];
var machine = itemVMID + "|" + itemName;
rp.push(machine);
vms[rgName] = rp;
scriptletContext.put("vMachines",JSON.stringify(vms));
scriptletResponse="success";

var vms = scriptletContext.get("vMachines");
if(vms != undefined) {
	vms = JSON.parse(vms);
	vms[rgName] = [];
}
else {
	vms = {};
	vms[rgName] = [];
}
scriptletContext.put("vMachines",JSON.stringify(vms));
scriptletResponse="success";
